"use strict"
const BITBOXSDK = require("bitbox-sdk")
const BITBOX = new BITBOXSDK()
const QRCode = require("qrcode")
const prompt = require("prompt")
const touch = require("touch")
const mkdirp = require("mkdirp")
const fs = require("fs")
const pdf = require("html-pdf")
const emoji = require("node-emoji")
const chalk = require("chalk")
const addresses = []
const sleep = ms => new Promise(resolve => setTimeout(resolve, ms))
// Open the wallet generated with generate-wallet.
const main = async () => {
  // start the prompt to get user input
  prompt.start()

  // ask for language, hdpath and walletFileName
  prompt.get(
    ["eventName", "hdAccount", "addressCount"],
    async (err, result) => {
      let mnemonicObj
      try {
        mnemonicObj = require(`./goldenTicketWallet.json`)
      } catch (err) {
        console.log(
          `Could not open mnemonic.json. Generate a mnemonic with generate-wallet first.
      Exiting.`
        )
        process.exit(0)
      }

      // create needed directory structure
      mkdirp(`./html`, err => {})
      mkdirp(`./html/${result.eventName}`, err => {})
      mkdirp(`./html/${result.eventName}/privKeyWIFs`, err => {})

      mkdirp(`./pdf`, err => {})
      mkdirp(`./pdf/${result.eventName}`, err => {})
      mkdirp(`./pdf/${result.eventName}/privKeyWIFs`, err => {})

      // root seed buffer
      const rootSeed = BITBOX.Mnemonic.toSeed(mnemonicObj.mnemonic)

      // master HDNode
      const masterHDNode = BITBOX.HDNode.fromSeed(rootSeed)

      // BIP44
      const bip44 = BITBOX.HDNode.derivePath(masterHDNode, "m/44'/145'")

      for (let i = 0; i < result.addressCount; i++) {
        console.log(`html: ${i}`)
        await sleep(100)
        // derive the ith external change address from the BIP44 account HDNode
        const node = BITBOX.HDNode.derivePath(
          bip44,
          `${result.hdAccount ? result.hdAccount : 0}'/0/${i}`
        )

        // get the priv key in wallet import format
        const wif = BITBOX.HDNode.toWIF(node)
        addresses.push({
          wif: wif
        })

        // create empty html file
        touch(
          `./html/${result.eventName}/privKeyWIFs/paper-wallet-wif-${i}.html`
        )

        // create qr code
        QRCode.toDataURL(wif, (err, wifQR) => {
          // save to html file
          fs.writeFileSync(
            `./html/${result.eventName}/privKeyWIFs/paper-wallet-wif-${i}.html`,
            `
        <body style="padding: 0; margin: 0;">
        <div style="height: 100%; background-size: cover; background-position: no-repeat left center; background-image:

url('data:image/jpeg;base64,')
">
          <img style='position: absolute; top: 465px; left: 185px; height: 110px;' src='${wifQR}' />
        </div>
        </body>
      `
          )
        })
      }

      for (let i = 0; i < result.addressCount; i++) {
        console.log(`pdf: ${i}`)
        await sleep(2000)

        // save to pdf
        var options = {
          width: "170mm",
          height: "260mm"
        }

        // get html file
        const privKeyWIFsHtml = fs.readFileSync(
          `./html/${result.eventName}/privKeyWIFs/paper-wallet-wif-${i}.html`,
          "utf8"
        )

        // save to pdf
        pdf
          .create(privKeyWIFsHtml, options)
          .toFile(
            `./pdf/${result.eventName}/privKeyWIFs/paper-wallet-wif-${i}.pdf`,
            (err, res) => {
              if (err) return console.log(err)
            }
          )
      }
      console.log(chalk.green("All done."), emoji.get(":white_check_mark:"))
      console.log(emoji.get(":rocket:"), `html and pdfs written successfully.`)
    }
  )
}

main()
